import Carousel from "react-bootstrap/Carousel";

class SlideShow extends React.Component {
  render() {
    return (
      <div style={{ height: "auto", width: "auto" }}>
        <span /> <span /> <span /> <span /> <span /> <span />
      </div>
    );
  }
}

export default SlideShow;
